VOICEMACRO_20_Hu_5_FEMALE = "Je ne trouve nulle part où me faire faire les ongles.";
VOICEMACRO_20_Hu_6_FEMALE = "J'ai hâte que la quête soit terminée et que je puisse aller chercher un autre artefact de M. Garibaldi.";
VOICEMACRO_20_Ni_0 = "La nuit dernière, j'étais à un horrible enterrement de vie de garçon.";
VOICEMACRO_20_Ni_0_FEMALE = "Je ne dois jamais cesser de me déplacer la nuit sous peine de disparaître.";
VOICEMACRO_20_Ni_1 = "Vous connaissez les Anciens protecteurs de Darnassus ? Ils ne sont pas si vieux que ça.";
VOICEMACRO_20_Ni_1_FEMALE = "En fait, je suis plutôt une elfe du matin.";
VOICEMACRO_20_Ni_2 = "J'étais à mi-chemin du Rêve d'émeraude quand j'ai dû me lever pour me soulager.";
VOICEMACRO_20_Ni_2_FEMALE = "Vous savez, les Feux follets sont plutôt utiles pour l'hygiène personnelle.";
VOICEMACRO_20_Ni_3 = "Ce truc est coupant ? Ça pourrait me couper ? Je ne suis pas immortel, vous savez !";
VOICEMACRO_20_Ni_3_FEMALE = "Je crois que ce type se sert du Rêve d'émeraude comme excuse pour ne pas me rappeler.";
VOICEMACRO_20_Ni_4 = "Je ne sais pas pour vous, mais je ne comprends rien à ce que disent les feux follets. Je hoche la tête, c'est tout.";
VOICEMACRO_20_Ni_4_FEMALE = "Oh, voilà que je danse à nouveau. J'espère que vos amis apprécient le spectacle.";
VOICEMACRO_20_Ni_5 = "Qui veut être éternel ?";
VOICEMACRO_20_Ni_6 = "Quoi ? Je n'avais pas entendu ça.";
VOICEMACRO_20_Ni_7 = "Les gnomes ne me dérangent pas, mais j'ai toujours peur de marcher dessus.";
VOICEMACRO_20_Or_0 = "Je tuerai et détruirai et... Ohhh. Ça brille...";
VOICEMACRO_20_Or_0_FEMALE = "Éloignez-vous de ma nourriture ou vous y perdrez la tête.";
VOICEMACRO_20_Or_1 = "C'est pas facile d'être vert.";
VOICEMACRO_20_Or_1_FEMALE = "Je n'ai pas de respect pour les gens qui ont de petits piercings. Allez-y franco. Mettez-vous une lance au travers du crâne.";
VOICEMACRO_20_Or_2 = "Là, c'est comme si je vous sentais bien, mais je vous sens mal, vous comprenez ?";
VOICEMACRO_20_Or_2_FEMALE = "Je me sens très féminine et je fracasserai le crâne de tous ceux qui ne sont pas d'accord.";
VOICEMACRO_20_Or_3 = "La Horde des orcs, c'est nous. On mange vraiment de tout. Il en faut pour tous les goûts.";
VOICEMACRO_20_Or_3_FEMALE = "C'est quoi un œstrogène ? Ça se mange ?";
VOICEMACRO_20_Or_4 = "Les orcs, ça bâche !";
VOICEMACRO_20_Or_4_FEMALE = "Il va de nouveau falloir que je m'épile la poitrine.";
VOICEMACRO_20_Or_5 = "Arrêtez de me pousser ! Bon, ça, à la rigueur.";
VOICEMACRO_20_Or_5_FEMALE = "Oh là, je sens remonter cette viande de sanglier. Faut faire quelque chose. Quelqu'un a une Pierre de foyer ?";
VOICEMACRO_20_Sc_0 = "Je ne supporte pas l'odeur des orcs.";
VOICEMACRO_20_Sc_0_FEMALE = "Je me serai bien verni les ongles, mais je ne sais pas où ils sont tombés.";
VOICEMACRO_20_Sc_1 = "Je suis mort et j'en ai marre.";
VOICEMACRO_20_Sc_1_FEMALE = "Oui, ils sont vrais ! C'est pas les miens mais ils sont vrais !";
VOICEMACRO_20_Sc_2 = "Les roses sont grises, les bleuets sont gris. Pas drôle d'être mort.";
VOICEMACRO_20_Sc_2_FEMALE = "Le monde est pourri.";
VOICEMACRO_20_Sc_3 = "Morve, bave et pleurs, le mort sombre dans le lagon. “Quel bonheur !”, dit le murloc, mais le nain botta l’cul du Profond.";
VOICEMACRO_20_Sc_3_FEMALE = "Ça sent mauvais.";
VOICEMACRO_20_Sc_4 = "Quelqu'un a de l'odorant ? “Chien mouillé”, “Détritus pour hommes” ou “Marée basse” feraient très bien l'affaire.";
VOICEMACRO_20_Sc_4_FEMALE = "Vous savez, quand on est mort, plus rien ne sent mauvais. Les oeufs pourris ? Pas de problème. Le poisson mort ? Une brise d'été !";
VOICEMACRO_20_Sc_5_FEMALE = "Pas besoin de déodorant quand on n'a pas d'aisselles.";
VOICEMACRO_20_Sc_6_FEMALE = "Ah, j'ai attrapé la mort.";
VOICEMACRO_20_Sc_7_FEMALE = "Je crois que j'ai perdu ma rotule dans le lac. Ça n'arrive qu'à moi.";
VOICEMACRO_20_Ta_0 = "Embêter un taureau, ça finit par un coup de cornes.";
VOICEMACRO_20_Ta_0_FEMALE = "Dans ma langue natale, mon nom signifie \"Danse avec les pompons\".";
VOICEMACRO_20_Ta_1 = "Tiens, voilà le boeuf...";
VOICEMACRO_20_Ta_1_FEMALE = "Un jour j'ai tellement rigolé que j'en ai lâché mon lait sur le sol.";
VOICEMACRO_20_Ta_2 = "Rien d'homogène entre nous. J'aime les dames.";
VOICEMACRO_20_Ta_2_FEMALE = "Les joyeux taurens viennent de Mulgore.";
VOICEMACRO_20_Ta_3 = "Vous savez, les taurens sont des chasseurs-nés. Vous avez déjà vu un tauren attraper un saumon dans un ruisseau ? C'est très impressionnant. Vous avez déjà vu un tauren traquer un python ? Bien sûr que non. C'est parce que les taurens savent se fondre dans leur environnement.";
VOICEMACRO_20_Ta_3_FEMALE = "C'est difficile de se sentir léger quand vous avez l'esprit de votre grand-mère en permanence sur le dos.";
VOICEMACRO_20_Ta_4 = "Meuh. Voilà, vous êtes content ?";
VOICEMACRO_20_Tr_0 = "La cuisine est faite. Le brouet est ici.";
VOICEMACRO_20_Tr_0_FEMALE = "Ma mauvaise haleine fait partie de mes charmes féminins.";
VOICEMACRO_20_Tr_1 = "J'aime les femmes rondes avec des poils tombants.";
