VOICEMACRO_20_Tr_2 = "J'ai la tête rétrécie, mais c'est parce que je sors de la mare.";
VOICEMACRO_20_Tr_2_FEMALE = "J'ai aussi une forte personnalité.";
VOICEMACRO_20_Tr_3 = "Un troll que j'ai jamais vu.";
VOICEMACRO_20_Tr_3_FEMALE = "Il paraît qu'on tient les hommes par l'estomac, mais je préfère les tripes.";
