VOICEMACRO_20_Tr_4_FEMALE = "Si le cannibalisme, c'est mal, eh ben tant pis.";
VOICEMACRO_20_Tr_5 = "Il paraît que si on en coupe un bout, il repousse plus grand. J'y crois pas.";
